.
.
In any given day, about a hundred things remind me that my body doesn't function the way most people's do - from climbing a flight of stairs to sun tanning to going to sleep at night, the dysfunction of my body is rarely not on my mind.
.
The thing that is the most clear reminder of all though, is anything centered around food - birthday parties, weddings, weekends away from home, all of them centre around food, and not food that fits my normal routine. I eat the same things all the time; I know what meds to take with them, and I know how my body reacts to those foods. So I often find when I'm out of the house, food centred activities can cause me a lot of anxiety.
.
Good friends make it so much easier. They make the discomfort of foods I know my system can't handle more handleable, and the whole process far more worth it. So, if you have a chronically ill friend, here's your reminder to check in on them at food centered events. üñ§
